    "https://wallpaperaccess.com/full/317501.jpg",
    "https://wallpaperaccess.com/full/317501.jpg",
    "https://wallpaperaccess.com/full/317501.jpg",
    "https://wallpaperaccess.com/full/317501.jpg",
]
export function Example() {
  return (
    <Stack space={3} alignItems="center">
      <HStack space={3} alignItems="center">
          {urlList.map(ur=>{
            <Image
                size={150}
                resizeMode={"contain"}
                borderRadius={100}
                source={{
                    uri: url,
